import React from 'react';
import './data.css'

import {ResponsiveContainer,BarChart,Bar,XAxis,YAxis,Tooltip,LabelList } from "recharts";
import Navbar from './Navbar/Navbar';

const Array =[

    {
        name:"Onion",
        Student:13,
        fees:10000
    },
    {
        name:"Tomato",
        Student:15,
        fees:7000
    },
    {
        name:"Wheat",
        Student:5,
        fees:5000
    },
    {
        name:"Soyabeen",
        Student:13,
        fees:10000
    },
    {
        name:"Cotton",
        Student:10,
        fees:10000
    },
    {
        name:"Maize",
        Student:10,
        fees:6000
    },
    {
        name:"Maize",
        Student:10,
        fees:6000
    },
    {
        name:"Remain",
        Student:15,
        fees:1000
    }

]



function Data() {
    let max =20;
   
  return (
   
    <>
    <Navbar/>
    <div className='barChart'>
       
 <h1>Crop Data</h1>
    <div className="continer">
    
   
    <ResponsiveContainer width="30%" aspect={1.5} >
        <BarChart data={Array} width={200} height={400}>
            <XAxis dataKey="name" />
            <YAxis dataKey="Student" />
            <Bar dataKey="Student" fill='green' radius={[4,4,0,0]} barSize={20} bar/>
            <Tooltip/>
        </BarChart>
      </ResponsiveContainer>
    
    
    </div>      


    <div style={{ width: 500, height: 300 }}>
        <ResponsiveContainer width="100%" height="100%">
          <BarChart width={150} height={40} data={Array}>
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="uv" fill="rgb(12, 12, 97)">
              <LabelList dataKey="uv" position="top" />
            </Bar>
            <Bar dataKey="pv" fill="rgb(59, 180, 59)" >
              <LabelList dataKey="pv" position="top" />
            </Bar>
          </BarChart>
        </ResponsiveContainer>

        </div>

    </div>
    </>
  )
}

export default Data;
